-- Create date: <Create Date,,>
-- Description:	<Description,,>
-- =============================================
CREATE PROCEDURE [dbo].[PLInsertarNuevoProducto]
	@NOMBRE_PROD VARCHAR(50),
	@MARCA VARCHAR(50),
	@CATEGORIA INT,
	@TAMANO VARCHAR(50),
	@USERID VARCHAR(100)
AS
BEGIN
	
	DECLARE @IDPRODUCTO INT
	
	INSERT INTO [Producto]
           ([Nombre]
           ,[Descripcion]
           ,[Cantidad]
           ,[Marca]
           ,[Categoria]
           ,[Foto]
           ,[Visitado])
     VALUES
           (@NOMBRE_PROD
           ,@NOMBRE_PROD+' - '+@MARCA
           ,@TAMANO
           ,@MARCA
           ,@CATEGORIA
           ,
         
           ,'0')
       
    SELECT @IDPRODUCTO = MAX(idProducto) FROM Producto
               
    INSERT INTO [Producto_log]
           ([idProducto]
           ,[Nombre]
           ,[Descripcion]
           ,[Foto]
           ,[usuario_log]
           ,[fecha_log]
           ,[operacion_log])
     VALUES
           (@IDPRODUCTO
           ,@NOMBRE_PROD
           ,@NOMBRE_PROD+' - '+@MARCA
           ,
        
           ,@USERID
           ,GETDATE()
           ,'A')
END

GO


